import Order from './components/Order'; // Import the new component

function App() {
  return (
    <Router>
      <Routes>
        <Route path="/" element={<Registration />} />
        <Route path="/login" element={<Login />} />
        <Route path="/welcome" element={<Welcome />} />
        <Route path="/order" element={<Order />} /> {/* New Order page route */}
      </Routes>
    </Router>
  );
}

export default App;
